import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./headers.css"

class Header extends Component {
    constructor(props) {
        super(props);
        this.state = {
            logged_in: props.logged_in
        };
    }

    render() {
        let header;
        if (!this.state.logged_in) {
            header = <div className="container">
                <header
                    className="d-flex flex-wrap align-items-center justify-content-center justify-content-md-between py-3 mb-4 border-bottom">
                    <a href="/"
                       className="d-flex align-items-center col-md-3 mb-2 mb-md-0 text-dark text-decoration-none">
                        window drop
                    </a>

                    <ul className="nav col-12 col-md-auto mb-2 justify-content-center mb-md-0">
                        <li><a href="#" className="nav-link px-2 link-secondary">Home</a></li>
                        <li><a href="#" className="nav-link px-2 link-dark">FAQs</a></li>
                        <li><a href="#" className="nav-link px-2 link-dark">About</a></li>
                    </ul>

                    <div className="nav col-12 col-md-auto mb-2 justify-content-center mb-md-0">
                        <button type="button" className="btn px-2 btn-outline-primary me-2">Login</button>
                        <button type="button" className="btn px-2 btn-primary">Sign-up</button>
                    </div>
                </header>
            </div>;
        }
        return (
            header
        );
    }
}

export { Header };
